import React from 'react';

import './TodoList.css';
import Todo from '../Todo/Todo';

const dummyTodos = [
    { name: "Go to the market" },
    { name: "Learn MERN stack" },
    { name: "Ride bike!" }];


const TodoList = () => {
    return (
        <div className='todolist'>
            <div className='heading'>Things todo</div>
            {dummyTodos.map(obj => <Todo name={obj.name} />)}
        </div>
    );

}

export default TodoList;
